$(document).ready(function() {
	$('#datatable-buttons').DataTable(),
		$('#datatable')
			.DataTable({
				lengthChange: !1,
				buttons: [
					'copy',
					'excel',
					{
						extend: 'pdfHtml5',
						customize: function(doc) {
							doc.content.splice(0, 0, {
								margin: [ 0, 0, 0, 12 ],
								alignment: 'center',
								image:
                                'data:image/png;base64,'
									// 'data:image/jpeg;base64,'
									//'data:image/jpeg;base64,'
							});
						}
					},
					'colvis'
				]
			})
			.buttons()
			.container()
			.appendTo('#datatable-buttons_wrapper .col-md-6:eq(0)');
});
